package Data;public class SentimentNLTK{    private float compound;    private float positive;    private float negative;    private float neutral;    private String sentiment = null;    public SentimentNLTK() {    }    public float getPositive() {        return positive;    }    public float getNegative() {        return negative;    }    public float getNeutral() {        return neutral;    }    public String getSentiment() {        return sentiment;    }    public float getCompound() {        return compound;    }    public void setCompound(float compound) {        this.compound = compound;    }    public void setPositive(float positive) {        this.positive = positive;    }    public void setNegative(float negative) {        this.negative = negative;    }    public void setNeutral(float neutral) {        this.neutral = neutral;    }    public void setSentiment(String sentiment) {        this.sentiment = sentiment;    }    @Override    public String toString() {        return "SentimentNLTK{" +                "compound=" + compound +                ", positive=" + positive +                ", negative=" + negative +                ", neutral=" + neutral +                ", sentiment='" + sentiment + '\'' +                '}';    }}